import React from 'react';

const style = {
    h1: {
        fontSize:'30px',
        marginLeft: '30px',
        color: 'rgba(255, 250, 204, 1)',
        fontFamily: 'Roboto, sans-serif',
    }
}
export default function Outlines(){
    return(
        <div className = 'leftBlocks'>
            <h1 style ={style.h1}>Конспекты</h1>
            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>
        </div>
    )
}
